  <script>
import { mapState } from 'vuex';
import axios from 'axios';

export default {
    name: 'Register',
    computed: {
        ...mapState(['apiUrl'])
    },
    methods: {
      register() {
        let formData = new FormData(this.$refs.registerForm)
        fetch(this.apiUrl+'/register',{
            method:"POST",
            body: formData
        })
        .then(res => res.json())
        .then(res => {
            if(res.success === true){
                this.$router.push('/login')
            }
        })
    
    },
  }
}
  </script>
  
